function getQueryParams(a){a=a.split("+").join(" ");for(var c={},b,d=/[?&]?([^=]+)=([^&]*)/g;b=d.exec(a);)c[decodeURIComponent(b[1])]=decodeURIComponent(b[2]);return c}var id=getQueryParams(window.location.search).session;$("#fileupload").fileupload({formData:{example:"test"}});
$(function(){$("#fileupload").fileupload({formData:{session:id}});$("#fileupload").fileupload("option",{maxFileSize:1E7,acceptFileTypes:/(\.|\/)(gif|jpe?g|png)$/i,process:[{action:"load",fileTypes:/^image\/(gif|jpeg|png)$/,maxFileSize:1E7},{action:"save"}]});$("#fileupload .files").imagegallery();$("#theme-switcher").change(function(){var a=$("#theme");a.prop("href",a.prop("href").replace(/[\w\-]+\/jquery-ui.css/,$(this).val()+"/jquery-ui.css"))})});